import React from 'react';
import Button from "react-bootstrap/Button";
import Navbar from "react-bootstrap/Navbar";
import Nav from "react-bootstrap/Nav";
import NavbarBrand from "react-bootstrap/NavbarBrand";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faSignOutAlt } from '@fortawesome/free-solid-svg-icons'
import { faBoxOpen } from '@fortawesome/free-solid-svg-icons'
import { faCoins } from '@fortawesome/free-solid-svg-icons'
import { faUserShield } from '@fortawesome/free-solid-svg-icons'
import { faWarehouse } from '@fortawesome/free-solid-svg-icons'
import { faPlusSquare } from '@fortawesome/free-solid-svg-icons'

import styled from "styled-components";

import logo from "../images/pokepacksonline.png"

const Styles = styled.div`
.nav-link{
    color: #FFFFFF !important;
}

.navbar{
    background-color: #272727 !important;
}
`

const Logo = styled.img`
height: auto;
width: 30%;
`


export default class NavbarComponent extends React.Component{

    handleLogOut = (event) =>{
        event.preventDefault();
        let dataToParent = {
            logOut: true
        }
        this.props.callbackToParent(dataToParent);
    }

    handleInventory = (event) =>{
        event.preventDefault();
        let dataToParent = {
            inventory: true
        }
        this.props.callbackToParent(dataToParent);
    }

    handleOpenPacks = (event) =>{
        event.preventDefault();
        let dataToParent = {
            openPacks: true
        }
        this.props.callbackToParent(dataToParent);
    }

    handleAddPacks = (event) =>{
        event.preventDefault();
        let dataToParent = {
            addPack: true
        }
        this.props.callbackToParent(dataToParent);
    }

    render() {
        //<Logo className="float-left" src={logo}>
        //<NavbarBrand style={{color: "#FFFFFF", fontSize: "2rem",}}></NavbarBrand>
        return (
            <Styles>
                <Navbar>
                    <Logo src={logo}></Logo>

                    <Nav className="ml-auto">
                        <Nav.Link href="#" onClick={this.handleOpenPacks}><FontAwesomeIcon icon={faBoxOpen}/> Open Packs</Nav.Link>
                        <Nav.Link href="#" onClick={this.handleAddPacks}><FontAwesomeIcon icon={faPlusSquare}/> Add New Pack From API</Nav.Link>
                        <Nav.Link href="#" onClick={this.handleInventory}><FontAwesomeIcon icon={faWarehouse}/> Inventory</Nav.Link>
                        <Nav.Link href="#"><FontAwesomeIcon icon={faCoins}/> Shop</Nav.Link>
                        <Nav.Link href="#"><FontAwesomeIcon icon={faUserShield}/> Admin</Nav.Link>
                        <Nav.Link href="#" onClick={this.handleLogOut}><FontAwesomeIcon icon={faSignOutAlt}/> Log Out</Nav.Link>
                    </Nav>
                </Navbar>
            </Styles>
            
        );
    }
}
